import React from 'react'
import {
  View, Text,
} from 'react-native'

const Main = () => (
  <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
    <Text>Welcome to DEV&apos;s React Native Starter!</Text>
  </View>
)


export default Main
